CREATE DEFINER=`root`@`%` PROCEDURE `ProcSelectAccionesSubCategoria` (IN `P_idSubCategoria` INT, IN `P_NomVariable` VARCHAR(100), IN `P_NumAccion` INT, IN `P_Nom_Accion` VARCHAR(200))   select sa.idSubCategoria, sa.Desc_SubCategoria_Accion Acciones ,
(
select  max(Num_Accion) 
from acciones_logica_detalle lod INNER JOIN subcategoria_accion sac 
on lod.idSubCategoria_Accion =sac.idSubCategoria_Accion
 WHERE sac.idSubCategoria = sa.idSubCategoria and lod.idSubCategoria_Accion = sa.idSubCategoria_Accion 
  AND   lod.Estado =1
) NroAcciones,
ld.Num_Accion, al.Nom_Accion,  ld.Desc_Accion 
from acciones_logica_detalle ld inner join acciones_logica al
on ld.id_Accion = al.idAccion inner join subcategoria_accion sa 
on sa.idSubCategoria_Accion = ld.idSubCategoria_Accion
WHERE sa.idSubCategoria= P_idSubCategoria and sa.Desc_SubCategoria_Accion = P_NomVariable
AND ld.Num_Accion = CASE WHEN P_NumAccion = 0 THEN ld.Num_Accion ELSE P_NumAccion END
AND al.Nom_Accion = CASE WHEN P_Nom_Accion ='' THEN al.Nom_Accion  ELSE P_Nom_Accion END
AND ld.Estado = 1
order by sa.Desc_SubCategoria_Accion ASC , ld.Num_Accion ASC, al.idAccion ASC$$

CREATE DEFINER=`root`@`%` PROCEDURE `ProcUpdateInterfaz` (IN `P_IdInterfaz` INT, IN `P_Nombre` VARCHAR(50), IN `P_Url` VARCHAR(255), IN `P_Nivel` INT, IN `P_Modulo_principal` INT, IN `P_IdInterfaz_superior` INT, IN `P_Orden` INT, IN `P_Icono` VARCHAR(30), IN `P_Estado` INT, IN `P_Ingresado_por` INT, IN `P_Fecha_Registro` DATE, IN `P_Modificado_por` INT, IN `P_Fecha_Modificacion` DATE)   BEGIN
 
     UPDATE interfaz
     SET Orden = Orden + 1
     WHERE Orden >= P_Orden AND
     Nivel = P_Nivel ;
    
    UPDATE   interfaz
    SET Nombre = P_Nombre,
    Url = P_Url,
    Orden = P_Orden, 
    IdInterfaz_superior = P_IdInterfaz_Superior,
    Modificado_por = P_Ingresado_por,
    Fecha_Modificacion = sysdate() 
    WHERE idInterfaz = P_idInterfaz;
      
 
END$$

CREATE DEFINER=`root`@`%` PROCEDURE `ProcUpdateLicencias` ()   BEGIN
select Usuario_id,Estado,Ingresado_por
from licencia WHERE Estado = 1;


UPDATE licencia SET Estado = 0 
WHERE Periodo IS NOT NULL;


UPDATE licencia SET Periodo = CONCAT(EXTRACT(YEAR FROM NOW()),EXTRACT(MONTH FROM NOW())), 
Fecha_Inicio = DATE_FORMAT(NOW() ,'%Y-%m-01'), 
Fecha_Fin = LAST_DAY(NOW()) 
WHERE Periodo IS NULL;
END$$

CREATE DEFINER=`root`@`%` PROCEDURE `ProcUpdateLogSesion` (IN `P_Login` VARCHAR(20), IN `P_Password` VARCHAR(40), IN `P_LoggedIn` VARCHAR(40), IN `P_IP` VARCHAR(40), IN `P_Dispositivo` VARCHAR(40), IN `P_NombreDispositivo` VARCHAR(40), IN `P_Equipo` INT)   BEGIN
   set @idLog_Sesion = 0;
   SELECT eq.idLog_Sesion INTO @idLog_Sesion FROM equipo eq inner join usuario us
   on eq.idUsuario = us.idUsuario
   where  eq.Equipo = P_Equipo AND
   us.Login = P_Login;
   
    UPDATE  log_sesion   
    SET   LoggedIn = 'No',	
          Fecha_Cierre = sysdate()
	WHERE Login = P_Login   
    AND   idLog_Sesion = @idLog_Sesion ;
 	      
    
END$$

